import React from 'react';

const VisitorFeedback = () => {
  const feedbacks = [
    { comment: 'Amazing experience!', date: '2024-10-01' },
    { comment: 'Loved the new exhibition!', date: '2024-10-05' },
  ];

  return (
    <div style={{ padding: '20px' }}>
      <h1 style={{ fontSize: '24px', marginBottom: '15px' }}>Visitor Feedback</h1>
      <ul style={{ listStyleType: 'none', padding: '0' }}>
        {feedbacks.map((feedback, index) => (
          <li key={index} style={{ padding: '8px', border: '1px solid #ddd', borderRadius: '4px', marginBottom: '10px', backgroundColor: '#f9f9f9' }}>
            {feedback.comment} <br />
            <small>{feedback.date}</small>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default VisitorFeedback;
